import React from 'react'
import { FaSpotify } from 'react-icons/fa'

const Home = ({ accessToken }) => {
    return (
        <div className='grid grid-cols-2'>
            <FaSpotify className='text-spotify-green text-[200px]' />
            <FaSpotify className='text-spotify-green text-[200px]' />
            <FaSpotify className='text-spotify-green text-[200px]' />
        </div>
    )
}

export default Home
